import React from 'react';
import { NavLink } from 'react-router-dom';


const NavBar = () => (
    <footer className="d-flex justify-content-between bg-dark p-3" id="mainFooter">
        <div className="btn-group">
            <NavLink to="/" className="btn btn-outline-primary bg-primary" exact={true}><i className="fa fa-bars"></i></NavLink>
            <NavLink to="/completed" className="btn btn-outline-primary bg-primary"><i className="fa fa-check-square"></i></NavLink>
            <NavLink to="/add-task" className="btn btn-outline-primary bg-primary" exact={true}><i className="fa fa-navicon"></i></NavLink>
        </div>
        <button className="btn btn-outline-dark bg-light"><i className="fa fa-check-square"></i></button>
    </footer>
)

export default NavBar
